import React from "react";
import "../styles/UserPage.css";

const MusicList = ({ musicTracks, onSelectTrack }) => {
  return (
    <div className="music-list">
      <ul>
        {musicTracks.map((track) => (
          <li
            key={track.id}
            onClick={() => onSelectTrack(track)}
            style={{
              padding: "10px",
              marginBottom: "10px",
              cursor: "pointer",
              background: "#222",
              borderRadius: "8px",
              color: "#eee"
            }}
          >
            {track.title} <strong style={{ float: "right" }}>{track.artist}</strong>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default MusicList;
